import React from 'react';
import { Link } from 'react-router-dom';

const buttonStyle = {
  backgroundColor: 'orange', // 연주황색
  border: 'none',
  borderRadius: '8px', // 모서리 둥글게
  padding: '10px 20px',
  textDecoration: 'none',
  color: 'white',
};

function Home() {
  return (
    <div>
      <Link to="/product-registration" style={buttonStyle}>
        상품 등록하기
      </Link>
    </div>
  );
}

export default Home;
